<b>4.电压输出 </b> <br />
NPN型晶体管发射极接地，集电极带负载电阻输出的电路。 <br />
<br />
<b>5.集电极开路输出</b> <br />
NPN型直接从晶体管的集电极输出的电路。 <br />
<br />
<b>6.长线驱动器输出 </b><br />
长距离输出用集成电路，信号为正反方向输出，速度快，抗干扰能力强，还可以检测电缆的断线。<br />
<br />
<b>7.互补输出 </b><br />
